INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<div class=\"shinyBgDivWrp getTadCertified flex fadeInUp animated\">\r\n<div class=\"tadContainer\">\r\n<div class=\"shinyBgDiv flex\">\r\n<div class=\"txtArea\">\r\n<h4><a href=\"\"><a class=\"colorbox-node\" href=\"node/32\">Get TAD certified and earn industry-recognised credentials</a></h4>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 'TAD Home Page Block 1', 'full_html'),
(2, '<div class=\"footer-contact footer-div\">\r\n<div class=\"logo-area fadeInUp animated\"><img alt=\"\" src=\"sites/all/themes/tad/images/footer/footer-logo.png\" /></div>\r\n\r\n<h4>Contact Us</h4>\r\n\r\n<div class=\"footer-contact-det flex-col fadeInUp animated\">\r\n    <a href=\"tel:+91-9029133114\" class=\"footer-link\"><i class=\"fa fa-phone\" aria-hidden=\"true\"></i><span class=\" numerical\"> +91 - 90291 33114</span></a>\r\n\r\n    <a href=\"mailto:counsellor@tadtheuxacademy.com\" class=\"footer-link\"><i class=\"fa fa-envelope\" aria-hidden=\"true\"></i><span class=\"email\"> counsellor@tadcourses.com</span></a>\r\n</div>\r\n\r\n<div class=\"footer-social\">\r\n    <a href=\"https://www.facebook.com/TADCOURSES/\" target=\"_blank\"><i class=\"fa fa-facebook\" aria-hidden=\"true\"></i></a>\r\n    <a href=\"https://in.linkedin.com/company/tadcourses/\" target=\"_blank\"><i class=\"fa fa-linkedin\" aria-hidden=\"true\"></i></a>\r\n    <a href=\"https://twitter.com/tadcourses\" target=\"_blank\"><i class=\"fa fa-twitter\" aria-hidden=\"true\"></i></a>\r\n    <a href=\"https://www.instagram.com/tadcourses/\" target=\"_blank\"><i class=\"fa fa-instagram\" aria-hidden=\"true\"></i></a>\r\n</div>\r\n\r\n</div>\r\n', 'Contact us footer block', 'full_html'),
(3, '<h4>Become an mentor</h4>\r\n\r\n<p>Supplement your income. Expand your network,Mentor young minds</p>\r\n\r\n<div class=\"join-btn-area\"><a class=\"colorbox-node btn btn-red rmedium\" href=\"content/become-mentor\">Join Us</a></div>\r\n', 'Become a Mentor', 'full_html'),
(4, '<div class=\"shinyBgDiv flex\">\r\n\r\n<p>Get a callback from our counsellor and get the right career guidance</p>\r\n\r\n\r\n<a class=\"colorbox-node callback-btn btn btnTrans\" href=\"node/36\">Get a Callback</a>\r\n</div>\r\n', 'Callback form block', 'full_html'),
(5, '<div class=\"contact-counsellor-block\"><a class=\"btn btn-red rmedium\" href=\"contact-counsellor\">Contact Counsellor</a></div>\r\n', 'Contact Counsellor Block', 'full_html');
