INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'foundation_and_courses', 0, 1, 1, 'und', 0, '<p>Develop a deep understanding of usability principles, user needs and design best...</p>\r\n', '', 'filtered_html'),
('node', 'foundation_and_courses', 0, 6, 6, 'und', 0, '<p>This covers the development of IoT products and services including devices for sensing...</p>\r\n', '', 'filtered_html'),
('node', 'foundation_and_courses', 0, 7, 7, 'und', 0, '<p>AI is the next big thing in the tech field and a huge number of organizations are adopting AI...</p>\r\n', '', 'filtered_html'),
('node', 'foundation_and_courses', 0, 8, 8, 'und', 0, '<p>In this program, you’ll learn the basics of Blockchain Technology, Ethereum protocols...</p>\r\n', '', 'filtered_html'),
('node', 'highlights_of_courses', 0, 9, 9, 'und', 0, '<p>Content that is expert-reviewed and evidence-backed</p>\r\n', '', 'filtered_html'),
('node', 'highlights_of_courses', 0, 10, 10, 'und', 0, '<p>Developed and updated to cover every future prospect</p>\r\n', '', 'filtered_html'),
('node', 'highlights_of_courses', 0, 11, 11, 'und', 0, '<p>From foundation to advance level courses we cover a wide range of topics</p>\r\n', '', 'filtered_html'),
('node', 'highlights_of_courses', 0, 12, 12, 'und', 0, '\r\n<p>Attentively created by the world’s technology elite</p>\r\n', '', 'filtered_html'),
('node', 'journey_of_courses', 0, 13, 13, 'und', 0, '<p>Get yourself registered in any of our courses as per your interest to master in-demand skills.</p>\r\n', '', 'full_html'),
('node', 'journey_of_courses', 0, 14, 14, 'und', 0, '<p>Each course is like an interactive textbook, featuring videos, quizzes, and projects.</p>\r\n', '', 'filtered_html'),
('node', 'journey_of_courses', 0, 15, 15, 'und', 0, '<p>Connect with your mentors, discuss course material, and get help mastering concepts.</p>\r\n', '', 'filtered_html'),
('node', 'journey_of_courses', 0, 16, 16, 'und', 0, '<p>Complete the weekly assignments, finish your capstone project and prepare for the exam.</p>', '', 'filtered_html'),
('node', 'journey_of_courses', 0, 17, 17, 'und', 0, '<p>Get TAD certified, earn official recognition and industry-relevant credentials.</p>', '', 'filtered_html'),
('node', 'tad_features', 0, 22, 22, 'und', 0, '\r\n<p>Learn through an immersive experience with our self-paced courses</p>\r\n', '', 'filtered_html'),
('node', 'tad_features', 0, 23, 23, 'und', 0, '<p>All our mentors come with extensive industry experience and subject-matter expertise</p>\r\n', '', 'filtered_html'),
('node', 'tad_features', 0, 24, 24, 'und', 0, '<p>Valuable credentials and certificate courses help you advance your career</p>\r\n', '', 'filtered_html'),
('node', 'ready_steady_go', 0, 25, 25, 'und', 0, '<p>Our courses contain all-inclusive and evidence-based content</p>\r\n', '', 'full_html'),
('node', 'ready_steady_go', 0, 26, 26, 'und', 0, '<p>Experience a whole new way of learning with international mentors</p>\r\n', '', 'full_html'),
('node', 'ready_steady_go', 0, 27, 27, 'und', 0, '<p>TAD provides 100% placement assistance and career guidance</p>\r\n', '', 'full_html'),
('node', 'ready_steady_go', 0, 28, 28, 'und', 0, '<p>We offer industry -leading education at unbeatable prices.</p>\r\n', '', 'full_html'),
('node', 'ready_steady_go', 0, 29, 29, 'und', 0, '<p>TAD-CCE Certification is highly recognised in the industry.</p>\r\n', '', 'full_html'),
('node', 'page', 0, 33, 33, 'und', 0, '<div class=\"aboutUsIntroWrp\">\r\n<div class=\"tadContainer\">\r\n<div class=\"aboutUsIntro flex\">\r\n<div class=\"txtArea\">\r\n<div class=\"box\">\r\n<h4>Our Vision</h4>\r\n\r\n<p>To make TAD a global, most respected, and trusted education centre.</p>\r\n</div>\r\n\r\n<div class=\"box\">\r\n<h4>Our Mission</h4>\r\n\r\n<p>To provide quality training to aspiring professionals and to take education to masses where creativity of individuals can be honed. In addition, to endow professionals who have the right inclination and mindset with a career opportunity in the field of technology and design.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"imgArea flex\">\r\n<div class=\"topArea flex\">\r\n<div class=\"imgDiv\"><img src=\"sites/all/themes/tad/images/aboutuspage/introarea/1.png\" /></div>\r\n\r\n<div class=\"imgDiv\"><img src=\"sites/all/themes/tad/images/aboutuspage/introarea/2.png\" /></div>\r\n</div>\r\n\r\n<div class=\"bottomArea flex\">\r\n<div class=\"imgDiv\"><img src=\"sites/all/themes/tad/images/aboutuspage/introarea/3.png\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('node', 'news', 0, 34, 34, 'und', 0, '<p>TECHVED Consulting is a professionally managed ‘User Experience Design and Development’ consultancy based in India. We embrace...</p>\r\n', '', 'full_html'),
('node', 'news', 0, 35, 35, 'und', 0, '<p>Applications have been invited for certified course in User Experience (UX) and User Interface (UI) designing by Techved Consulting...</p>\r\n', '', 'filtered_html'),
('node', 'in_collaboration', 0, 37, 37, 'und', 0, '<p>Top power house for UX/UI innovation in India</p>\r\n', '', 'filtered_html'),
('node', 'in_collaboration', 0, 38, 38, 'und', 0, '<p>An interactive meetup with upbeat UX discussions</p>\r\n', '', 'full_html'),
('node', 'news', 0, 39, 39, 'und', 0, '<p>While lakhs of people are switching to digital media daily, very few consultants are available to find solutions to make digital space user-friendly. Sadly,..</p>\r\n\r\n<p>While lakhs of people are switching to digital...</p>\r\n', '', 'filtered_html'),
('node', 'course', 0, 45, 45, 'und', 0, '<p>When it comes to User Interface (UI) design, your job — whether you\'re a designer, developer, UXer or a mix of all those things — is to make sure that no aspect of someone’s onscreen interaction happens without explicit intent. The UI design choices we make have to reflect the user’s motivations, expectations, environment and possible actions.</p>\r\n\r\n<p>With this course, you\'ll learn how to create and apply hierarchy, colour, contrast, typography and gestalt principles to design appropriate visual cues so people know where and how to take action.</p>\r\n\r\n<p>By the time you finish Design Principles, you\'ll be able to do much more than create a more beautiful User Interface. Instead, you\'ll be able to design a UI that truly works for the people who use it and allows them to easily figure out where to start and how to get what they need — quickly, efficiently and intuitively.</p>\r\n', '', 'full_html'),
('node', 'mega_menu_content', 0, 52, 52, 'und', 0, '<p>TAD-Vedanta is our exclusive mentorship program.</p>\r\n\r\n<p>Sign up as a mentor and enjoy a host of benefits.</p>\r\n', '', 'filtered_html');
