('field_collection_item', 'field_faq_set', 0, 5, 5, 'und', 0, '<p>Each of TAD’s courses are created, owned and managed by the instructor(s). The foundation of each course is its lectures, which can include videos, slides, text and additional resources the instructor has uploaded. In addition, instructors can add quizzes, practice tests, assignments and coding exercises, as a way to enhance the learning experience of students.</p>\r\n', '', 'filtered_html'),
('field_collection_item', 'field_faq_set', 0, 6, 6, 'und', 0, '<p>Each of TAD’s courses are created, owned and managed by the instructor(s). The foundation of each course is its lectures, which can include videos, slides, text and additional resources the instructor has uploaded. In addition, instructors can add quizzes, practice tests, assignments and coding exercises, as a way to enhance the learning experience of students.</p>\r\n', '', 'full_html');
